import { List } from "@mui/material"

const ListFooterDesk = () => {
  return (
    <List sx={{
        '& > :first-child': {
          textTransform: 'uppercase',
          typography: { fontWeight: '600' }
        }
      }}></List>
  )
}

export default ListFooterDesk
